import React from "react";
import { Card } from 'react-bootstrap';
import "../App.css";
import resume from "../images/resume Mengyue Zhang.pdf"
import { Container, Row, Col} from 'react-bootstrap';

function About() {
  return (
    <Card className = "about-me-card ">
    <Card.Body>
      <Card.Title>About Me</Card.Title>
      <img src = "https://mengyue-z.github.io/Portfolio/images/aboutme.jpeg" className="img-fluid mr-2 mb-2 img-thumbnail"/>
      <Card.Text>
      Hello, my name is Mengyue Zhang. I am a recent graduate from George Washington University Full Stack Coding Bootcamp and current working towards a MS of Software Development degree in Boston University.
      <br/><br/>Thanks for visiting my site! Please feel free to reach me at the contact page.
      </Card.Text>
      <Card.Link href={resume} download = "resume" target="blank">View My Resume</Card.Link>
      <Card.Link href="/portfolio">View My Works</Card.Link>
    </Card.Body>
  </Card>
  );
}

export default About;
